import styled from "styled-components"
import { Link } from "react-router-dom"

export const SideBarLink = styled(Link)`
color : #200752;
display: flex;
flex-direction: row;
text-decoration : none;
cursor : pointer;


@media screen and (max-width: 960px){
    text-align: center;
    padding: 2rem;
    width: 100%;
    display: table;
}

`
